import { useState, useEffect } from "react"
import styles from "./Characters.module.css"

export default function FormAddCharacter(){
    //input states
    let [dataNewChar, setDataNewChar] = useState({name: "", status: "", species: "", origin: "", location: "", image: ""})

    //arrays to define the select options
    let arrSpecies = ['Human', 'Alien', 'Humanoid', 'Animal', 'Robot', 'Disease', 'Mythological Creature', 'Poopybutthole', 'unknown', 'Cronenberg'].sort((a,b)=>a.localeCompare(b))
    let arrStatus  = ['Alive', 'Dead', 'unknown']
    let arrOrigins = ['Earth (C-137)', 'Earth (Replacement Dimension)', 'Earth (K-83)', 'unknown']

    useEffect(()=>{localStorage.setItem('createdCharacters', JSON.stringify([]))})

    //function to submit
    const handleSubmit = e=>{
        e.preventDefault()
        const isFormFilled = dataNewChar.name!=="" && dataNewChar.status!=="" && dataNewChar.species!=="" && dataNewChar.origin!=="" && dataNewChar.location!=="" //true or false
        
        //local storage only supports strings, use JSON.stringify and JSON.parse
        if(isFormFilled){
            let createdChars = JSON.parse(localStorage.getItem('createdCharacters'))
            let newItems = [...createdChars, {...dataNewChar}]
            localStorage.setItem('createdCharacters', JSON.stringify(newItems))
            setDataNewChar({name: "", status: "", species: "", origin: "", location: "", image: ""})
        }
        else console.log("uncompleted data")
        console.log(localStorage.getItem('createdCharacters'))
    }
    
    return(
        <form className={styles.character_form} onSubmit={handleSubmit} name="add_form">
            <p className={styles.character_filterTitle}>Add a character</p>
            <label className={styles.add_property} htmlFor="name">Name:</label>
            <input className={styles.add_input} value={dataNewChar.name} htmlFor="name" onChange={e=>setDataNewChar({...dataNewChar, name: e.target.value})} type="text" placeholder="Example: Rick..."></input>

            <label className={styles.add_property} htmlFor="species">Species:</label>
            <select className={styles.add_input} value={dataNewChar.species} name="species" onChange={e=>setDataNewChar({...dataNewChar, species: e.target.value})}>
                <option value="">Select an option...</option>
                {arrSpecies.map((el,index)=><option value={el} key={index}>{el}</option>)}
            </select>

            <label className={styles.add_property} htmlFor="status">Status:</label>
            <select className={styles.add_input} name="status" value={dataNewChar.status} onChange={e=>setDataNewChar({...dataNewChar, status: e.target.value})}>
                <option value="">Select an option...</option>
                {arrSpecies.map((el,index)=><option value={el} key={index}>{el}</option>)}
            </select>

            <label className={styles.add_property} htmlFor="origin">Origin:</label>
            <select className={styles.add_input} value={dataNewChar.origin} name="origin" onChange={e=>setDataNewChar({...dataNewChar, origin: e.target.value})}>
                <option value="">Select an option...</option>
                {arrOrigins.map((el,index)=><option value={el} key={index}>{el}</option>)}
            </select>

            <label className={styles.add_property} htmlFor="location">Location:</label>
            <select className={styles.add_input} value={dataNewChar.location} name="location" onChange={e=>setDataNewChar({...dataNewChar, location: e.target.value})}>
                <option value="">Select an option...</option>
                {arrOrigins.map((el,index)=><option value={el} key={index}>{el}</option>)}
            </select>

            <label className={styles.add_image} htmlFor="image">Image:</label>
            <input type="file" value={dataNewChar.image} onChange={e=>setDataNewChar({...dataNewChar, image: e.target.value})} src="" alt="" accept=".jpg, .png" name="image"/><br></br>

            <button className={styles.character_submit} type="submit" name="submit">Submit</button>
        </form>
    )
}
